@import "@/styles/global-color.scss";

.selection-button {
  border-width: 0px;
  padding: 0 0 0 0;
  width: calc(100% - 32px);
  position: relative;
  line-height: 100%;
  text-align: center;
  border-radius: 5px;
}

.selection-group {

  display: table-cell;
  vertical-align: middle;

  .card {
    min-height: 150px;
    min-width: 150px;
    text-align: center;
    border-color: #dfdfdf;
  }

  .ui-selection {
    margin: 50px 0 10px 0;
  }

  .el-card__body {
    padding: 30px 0 0 0;
    font-size: large;
    text-align: center;
  }
}

.select-avatar {
  border-radius: 30%;
  padding: 5px;
  box-shadow: 0 0 0 1px #b0a5a4, 0 0 0 5px #fff;
  background-color: #FFFFFF;
}

.admin-type {
  float: right;
  padding-right: 20px;
  color: $admin-color;
  font-size: small;
}

.company-type {
  float: right;
  padding-right: 20px;
  color: $company-color;
  font-size: small;
}

.site-type {
  float: right;
  padding-right: 20px;
  color: $site-color;
  font-size: small;
}
